import React from 'react';
import './Landing.css';
import Navbar from "../../navbar/Navbar";
import Filter from "../../mainbar/filter/Filter";
import Posts from "../../mainbar/posts/Posts";
import CreatePostButton from "../../mainbar/createPostButton/CreatePostButton";

export default function Landing() {
    const handleCreatePost = () => {
        console.log("Navigate to post creation page or open modal"); // Here you can add navigation to a post creation form or open a modal
    };

    return (
        <div className="landing-page">
            <Navbar />
            <div className="welcome-message">
                <h1>Welcome to Our Blog!</h1>
                <p>Explore the latest posts, share your thoughts, and create your own content.</p>
            </div>
            <CreatePostButton onClick={handleCreatePost} />
            <Filter />
            <Posts />
        </div>
    );
}
